import React, { useState, useEffect } from 'react';
import {
  View,
  Text,
  StyleSheet,
  ScrollView,
  Alert
} from 'react-native';
import { collection, getDocs } from 'firebase/firestore';
import { db } from '../config/firebase';

const colors = {
  beeYellow: '#F4C430',
  honeyGold: '#D4AF37',
  darkYellow: '#B8860B',
  deepNavy: '#1A1B3E',
  charcoal: '#2C2C2C',
  cream: '#FFF9E6',
  white: '#FFFFFF',
  warmGray: '#6B6B6B',
  lightGray: '#F5F5F5',
  success: '#27AE60',
  danger: '#E74C3C',
  warning: '#F39C12'
};

interface TelegramChannel {
  id: string;
  username: string;
  name: string;
  imageUrl?: string;
  category: string;
  isActive: boolean;
  scrapingEnabled: boolean;
  totalJobsScraped: number;
  lastScraped?: Date;
}

const TelegramChannelsManager: React.FC = () => {
  const [channels, setChannels] = useState<TelegramChannel[]>([]);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    loadChannels();
  }, []);

  const loadChannels = async () => {
    try {
      setLoading(true);
      const channelsCollection = collection(db, 'telegramChannels');
      const channelsSnapshot = await getDocs(channelsCollection);

      const channelsData = channelsSnapshot.docs.map(doc => ({
        id: doc.id,
        ...doc.data()
      })) as TelegramChannel[];

      setChannels(channelsData);
    } catch (error) {
      console.error('Error loading channels:', error);
      Alert.alert('Error', 'Failed to load Telegram channels');
    } finally {
      setLoading(false);
    }
  };

  const renderChannelItem = (channel: TelegramChannel) => (
    <View key={channel.id} style={styles.channelItem}>
      <View style={styles.channelInfo}>
        <Text style={styles.channelName}>{channel.name}</Text>
        <Text style={styles.channelUsername}>@{channel.username}</Text>
        <Text style={styles.channelCategory}>Category: {channel.category}</Text>
        <Text style={styles.channelStats}>
          Jobs Scraped: {channel.totalJobsScraped || 0}
        </Text>
        {channel.lastScraped && (
          <Text style={styles.lastScraped}>
            Last Scraped: {channel.lastScraped instanceof Date 
              ? channel.lastScraped.toLocaleDateString() 
              : new Date(channel.lastScraped).toLocaleDateString()}
          </Text>
        )}
      </View>
      <View style={styles.statusIndicators}>
        <View style={[
          styles.statusDot, 
          { backgroundColor: channel.isActive ? colors.success : colors.danger }
        ]} />
        <Text style={styles.statusText}>
          {channel.isActive ? 'Active' : 'Inactive'}
        </Text>
      </View>
    </View>
  );

  return (
    <ScrollView style={styles.container}>
      <View style={styles.header}>
        <Text style={styles.title}>Telegram Job Scraping</Text>
        <Text style={styles.subtitle}>
          Automated job scraping is handled by the scheduled function
        </Text>
      </View>

      <View style={styles.functionStatus}>
        <View style={styles.functionCard}>
          <Text style={styles.functionTitle}>üìÖ Scheduled Telegram Scraping</Text>
          <Text style={styles.functionDescription}>
            The system automatically scrapes jobs from all active Telegram channels using AI-powered extraction.
          </Text>
          <View style={styles.functionDetails}>
            <Text style={styles.detailItem}>üîÑ Status: <Text style={styles.activeText}>Running</Text></Text>
            <Text style={styles.detailItem}>‚è∞ Schedule: Daily at configured times</Text>
            <Text style={styles.detailItem}>ü§ñ AI Processing: OpenAI GPT-3.5-turbo</Text>
            <Text style={styles.detailItem}>üíæ Storage: Firestore jobs collection</Text>
          </View>
        </View>
      </View>

      <View style={styles.channelsSection}>
        <Text style={styles.sectionTitle}>Configured Channels ({channels.length})</Text>
        {loading ? (
          <Text style={styles.loadingText}>Loading channels...</Text>
        ) : channels.length === 0 ? (
          <Text style={styles.emptyText}>No channels configured yet.</Text>
        ) : (
          channels.map(renderChannelItem)
        )}
      </View>

      <View style={styles.infoSection}>
        <Text style={styles.infoTitle}>How It Works</Text>
        <Text style={styles.infoText}>
          ‚Ä¢ The scheduled function runs automatically{'\n'}
          ‚Ä¢ It processes all active channels in your database{'\n'}
          ‚Ä¢ Uses AI to extract job details from messages{'\n'}
          ‚Ä¢ Saves structured job data to Firestore{'\n'}
          ‚Ä¢ Handles deduplication and categorization
        </Text>
      </View>

      <View style={styles.monitoringSection}>
        <Text style={styles.infoTitle}>Monitoring</Text>
        <Text style={styles.infoText}>
          ‚Ä¢ View logs: Firebase Console ‚Üí Functions ‚Üí Logs{'\n'}
          ‚Ä¢ Check saved jobs: Firebase Console ‚Üí Firestore ‚Üí jobs{'\n'}
          ‚Ä¢ Function runs based on your configured schedule{'\n'}
          ‚Ä¢ All processing happens automatically in the background
        </Text>
      </View>
    </ScrollView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: colors.cream,
    padding: 16,
  },
  header: {
    marginBottom: 24,
    alignItems: 'center',
  },
  title: {
    fontSize: 28,
    fontWeight: 'bold',
    color: colors.deepNavy,
    marginBottom: 8,
  },
  subtitle: {
    fontSize: 16,
    color: colors.warmGray,
    textAlign: 'center',
  },
  functionStatus: {
    marginBottom: 24,
  },
  functionCard: {
    backgroundColor: colors.white,
    borderRadius: 12,
    padding: 20,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.1,
    shadowRadius: 4,
    elevation: 3,
  },
  functionTitle: {
    fontSize: 20,
    fontWeight: 'bold',
    color: colors.deepNavy,
    marginBottom: 8,
  },
  functionDescription: {
    fontSize: 14,
    color: colors.warmGray,
    marginBottom: 16,
    lineHeight: 20,
  },
  functionDetails: {
    gap: 8,
  },
  detailItem: {
    fontSize: 14,
    color: colors.charcoal,
  },
  activeText: {
    color: colors.success,
    fontWeight: 'bold',
  },
  channelsSection: {
    marginBottom: 24,
  },
  sectionTitle: {
    fontSize: 20,
    fontWeight: 'bold',
    color: colors.deepNavy,
    marginBottom: 16,
  },
  loadingText: {
    fontSize: 16,
    color: colors.warmGray,
    textAlign: 'center',
    padding: 20,
  },
  emptyText: {
    fontSize: 16,
    color: colors.warmGray,
    textAlign: 'center',
    padding: 20,
    fontStyle: 'italic',
  },
  channelItem: {
    backgroundColor: colors.white,
    borderRadius: 8,
    padding: 16,
    marginBottom: 12,
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 1 },
    shadowOpacity: 0.05,
    shadowRadius: 2,
    elevation: 1,
  },
  channelInfo: {
    flex: 1,
  },
  channelName: {
    fontSize: 16,
    fontWeight: 'bold',
    color: colors.deepNavy,
    marginBottom: 4,
  },
  channelUsername: {
    fontSize: 14,
    color: colors.darkYellow,
    marginBottom: 4,
  },
  channelCategory: {
    fontSize: 12,
    color: colors.warmGray,
    marginBottom: 2,
  },
  channelStats: {
    fontSize: 12,
    color: colors.warmGray,
    marginBottom: 2,
  },
  lastScraped: {
    fontSize: 12,
    color: colors.warmGray,
  },
  statusIndicators: {
    alignItems: 'center',
    gap: 4,
  },
  statusDot: {
    width: 12,
    height: 12,
    borderRadius: 6,
  },
  statusText: {
    fontSize: 12,
    color: colors.warmGray,
  },
  infoSection: {
    marginBottom: 24,
    backgroundColor: colors.white,
    borderRadius: 8,
    padding: 16,
  },
  monitoringSection: {
    marginBottom: 24,
    backgroundColor: colors.lightGray,
    borderRadius: 8,
    padding: 16,
  },
  infoTitle: {
    fontSize: 16,
    fontWeight: 'bold',
    color: colors.deepNavy,
    marginBottom: 8,
  },
  infoText: {
    fontSize: 14,
    color: colors.charcoal,
    lineHeight: 20,
  },
});

export default TelegramChannelsManager;
